import React, { useEffect } from 'react';
import $ from 'jquery';
import 'owl.carousel/dist/assets/owl.carousel.css';
import 'owl.carousel/dist/assets/owl.theme.default.css';
import 'owl.carousel';

const Hero = () => {

    // useEffect(() => {
    //     document.querySelectorAll('.set-bg').forEach((element) => {
    //         const bg = element.getAttribute('data-setbg');
    //         element.style.backgroundImage = `url(${bg})`;
    //     });
    // }, []);

    useEffect(() => {
        const initializeCarousel = () => {
            if ($('.owl-carousel').length > 0) {
                $('.owl-carousel').owlCarousel({
                    items: 1,
                    loop: true,
                    autoplay: true,
                    autoplayTimeout: 5000,
                    nav: true,
                    dots: true,
                });
            }
        };

        initializeCarousel();
    }, []);

  return (
    <div>
          {/* <!-- Hero Section Begin --> */}
          <section className="hero">
              <div className="hero__slider owl-carousel">
                  {/* <div className="hero__items set-bg" data-setbg={Hero1}> */}
                  {/* <div className="hero__items" style={{ backgroundImage: `url(${Hero1})` }}> */}
                  <div className="hero__items" style={{ backgroundImage: `url(/assets/img/hero/hero1.jpg)` }}>
                      <div className="container">
                          <div className="row">
                              <div className="col-xl-5 col-lg-7 col-md-8">
                                  <div className="hero__text">
                                      <h6>Summer Collection</h6>
                                      <h2>Fall - Winter Collections 2030</h2>
                                      <p>A specialist label creating luxury essentials. Ethically crafted with an unwavering
                                          commitment to exceptional quality.</p>
                                      <a href="#" className="primary-btn">Shop now <span className="arrow_right"></span></a>
                                      <div className="hero__social">
                                          <a href="#"><i className="fa fa-facebook"></i></a>
                                          <a href="#"><i className="fa fa-twitter"></i></a>
                                          <a href="#"><i className="fa fa-pinterest"></i></a>
                                          <a href="#"><i className="fa fa-instagram"></i></a>
                                      </div>
                                  </div>
                              </div>
                          </div>
                      </div>
                  </div>
                  {/* <div className="hero__items set-bg" data-setbg={Hero2}> */}
                  {/* <div className="hero__items" style={{ backgroundImage: `url(${Hero2})` }}> */}
                  <div className="hero__items" style={{ backgroundImage: `url(/assets/img/hero/hero2.jpg)` }}>
                      <div className="container">
                          <div className="row">
                              <div className="col-xl-5 col-lg-7 col-md-8">
                                  <div className="hero__text">
                                      <h6>Summer Collection</h6>
                                      <h2>Fall - Winter Collections 2030</h2>
                                      <p>A specialist label creating luxury essentials. Ethically crafted with an unwavering
                                          commitment to exceptional quality.</p>
                                      <a href="#" className="primary-btn">Shop now <span className="arrow_right"></span></a>
                                      <div className="hero__social">
                                          <a href="#"><i className="fa fa-facebook"></i></a>
                                          <a href="#"><i className="fa fa-twitter"></i></a>
                                          <a href="#"><i className="fa fa-pinterest"></i></a>
                                          <a href="#"><i className="fa fa-instagram"></i></a>
                                      </div>
                                  </div>
                              </div>
                          </div>
                      </div>
                  </div>
              </div>
          </section>
          {/* <!-- Hero Section End --> */}
    </div>
  )
}

export default Hero
